import React, { Component } from 'react';
import { InputGroup, InputGroupAddon, Input, Button, Form } from 'reactstrap';
import { NameForm} from "react-router-dom";
class LoginPage extends Component {
    constructor(props) {
        super(props);
        this.state = {value: ''};

        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
      }

      handleChange(event) {
        this.setState({value: event.target.value});
      }

      handleSubmit(event) {
        alert('A name was submitted: ' + this.state.value);
        event.preventDefault();
      }
    render() {
        return (
            <div>
                <h1>LOGIN</h1>
                <div>
                    <Form onSubmit={this.handleSubmit}>
                        <InputGroup>
                            <InputGroupAddon addonType="prepend">@</InputGroupAddon>
                            <Input placeholder="username" type="text" value={this.state.value} onChange={this.handleChange} />
                        </InputGroup>
                        <br />
                        <InputGroup>
                            <InputGroupAddon addonType="prepend">Pass</InputGroupAddon>
                            <Input placeholder="password " />
                        </InputGroup>
                        <br />
                        <Button>Login</Button>
                    </Form>
                </div>

            </div>
        );
    }
}
ReactDOM.render(
    <NameForm />,
    document.getElementById('root')
  );

export default LoginPage;
